 long long unsigned int AckermanFunction(unsigned long long int m, unsigned long long int n)
{
    if (m == 0)
        return (n + 1);
    if (m > 0 && n == 0)
        return AckermanFunction(m - 1, 1);
    if (m > 0 && n > 0)
        return AckermanFunction(m - 1, AckermanFunction(m, n - 1));
    return n;
}
 long long unsigned int FibonacciSequence(int n)
{
    if (n == 0)
        return 0;
    if (n == 1)
        return 1;
    long long unsigned int a = 0;
    long long unsigned int b = 1;
    long long unsigned int sum;
    for (int i = 2; i <= n; i++)
    {
        sum = a + b;
        a = b;
        b = sum;
    }        
    return b;
}
int SieveOfEratosthenes(bool* &prime, long long unsigned int n)
{      
    prime = new bool[n+1];          
    memset(prime, true, sizeof(bool) * n+1);    
    for (long long unsigned int p = 2; p * p <= n; p++)
    {
        if (prime[p])
        {
            for (long long unsigned int i = p * p; i <= n; i += p)
                prime[i] = false;
        }
    }
    int primeNumbersCount = 0;
    for (long unsigned int i = 2; i< n + 1; i++){
        if(prime[i])
            primeNumbersCount++;
    }        
    return primeNumbersCount;
    
}
bool gauss(int n, double **AB, double *X)
{
    const double eps = 1e-12;
    int i, j, k;
    double m, s;
    
    for (i = 0; i < n - 1; i++)
    {
        for (j = i + 1; j < n; j++)
        {
            if (fabs(AB[i][i]) < eps)
                return false;
            m = -AB[j][i] / AB[i][i];
            for (k = i + 1; k <= n; k++)
                AB[j][k] += m * AB[i][k];
        }
    }   

    for (i = n - 1; i >= 0; i--)
    {
        s = AB[i][n];
        for (j = n - 1; j >= i + 1; j--)
            s -= AB[i][j] * X[j];
        if (fabs(AB[i][i]) < eps)
            return false;
        X[i] = s / AB[i][i];
    }
    return true;
}
int partition(int array[], int low, int high)
{
    int x = array[low];
    int i = low, j = high, w;
    while (true)
    {
        while (array[j] > x)
            j--;
        while (array[i] < x)
            i++;
        if (i < j)
        {
            w = array[i];
            array[i] = array[j];
            array[j] = w;
            i++;
            j--;
        }
        else
            return j;
    }
}

void quickSort(int *array, int low, int high)
{
    int pivot;
    if (low < high)
    {
        pivot = partition(array, low, high);
        quickSort(array, low, pivot);
        quickSort(array, pivot + 1, high);
    }
}

long long unsigned int customMethod(int* &array)
{
    int moduloNumber = 867;
    long long unsigned int sum = 0;
    int array_length = 1000000;
    int innerLoopBound = 100000;
    array = new int[array_length];

    for (int index = 0; index < array_length; index++)
        array[index] = index % moduloNumber;

    quickSort(array, 0, array_length - 1);
    for (int iteration = 0; iteration < 100; iteration++)
        for (int innerloop = 0; innerloop < innerLoopBound; innerloop++)
            sum += array[(iteration + innerloop) % array_length];        
    return sum;
    
}

void testCustomMethod(int testNumber)
{    
    for (int i = 0; i < testNumber; i++)
    {
        int *array;
        std::chrono::steady_clock::time_point begin = std::chrono::steady_clock::now();
        auto result = customMethod(array);
        std::chrono::steady_clock::time_point end = std::chrono::steady_clock::now();
        auto elapsedTime = std::chrono::duration_cast<std::chrono::microseconds>(end - begin).count();
        if(result != 428714300)
            cout<<"Wrong result!" <<endl;
        delete[] array;            
        cout << "custom_cpp, " << (float)elapsedTime / 1000 << endl;
    }

}

