void testAckerman(int testNumber)
{    
    for (int i = 0; i < testNumber; i++)
    {
        std::chrono::steady_clock::time_point begin = std::chrono::steady_clock::now();
        auto result = AckermanFunction(3, 10);        
        std::chrono::steady_clock::time_point end = std::chrono::steady_clock::now();
        auto elapsedTime = std::chrono::duration_cast<std::chrono::microseconds>(end - begin).count();
        if(result != 8189)
            cout<<"Wrong ackerman result!"<<endl;    
        cout << "ackerman_cpp, " << (float)elapsedTime / 1000 << endl;
    }    
}
